import React, { useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./style.css";

const Navbar = () => {
  return (
    <div className="topnav">
      <Link to="/admin-login">Admin Login</Link>
      <Link to="/login-doctor">Doctor Login</Link>
      <Link to="/user-registration">Sign Up as User</Link>
      <Link to="/user-login" className="home">
        <img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home" />
      </Link>
    </div>
  );
};

const updateFavicon = (faviconURL) => {
  const favicon = document.querySelector('link[rel="icon"]');
  if (favicon) {
    favicon.href = faviconURL;
  } else {
    const newFavicon = document.createElement("link");
    newFavicon.rel = "icon";
    newFavicon.href = faviconURL;
    document.head.appendChild(newFavicon);
  }
};

const updateWebpageTitle = (title) => {
  document.title = title;
};

const UserLogin = () => {
  const validateUserLogin = (event) => {};

  useEffect(() => {
    updateFavicon(
      //"https://cdn.iconscout.com/icon/free/png-512/free-user-1851010-1568997.png?f=webp&w=512"
      "https://cdn.iconscout.com/icon/free/png-512/free-user-employee-avatar-man-person-businessman-15-17179.png?f=webp&w=512"
    );
    updateWebpageTitle("User Login");
  }, []);

  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>User Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateUserLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const AdminLogin = () => {
  const validateAdminLogin = (event) => {};
  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/premium/png-512-thumb/admin-1-32-687612.png?f=webp&w=512"
    );
    updateWebpageTitle("Admin Login");
  }, []);
  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>Admin Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateAdminLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const DoctorLogin = () => {
  const validateDoctorLogin = (event) => {};
  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/premium/png-512-thumb/doctor-567-1118047.png?f=webp&w=512"
    );
    updateWebpageTitle("Doctor Login");
  }, []);
  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>Doctor Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateDoctorLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const UserRegistration = () => {
  const handleRegistration = (event) => {
    event.preventDefault();
    // Add your registration logic here
  };

  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/free/png-512/free-user-add-plus-contact-account-new-create-7-3318.png?f=webp&w=512"
    );
    updateWebpageTitle("User Registration");
  }, []);
  return (
    <div>
      <Navbar />
      <div class="login-container">
    <h2>User Registration</h2>
    <form id="registrationForm" action="register.php" method="post">
      <label for="firstName" class="required">First Name:</label>
      <input type="text" id="register-firstName" name="register-firstName" required /><br />

      <label for="middleName">Middle Name:</label>
      <input type="text" id="register-middleName" name="register-middleName" /><br />

      <label for="lastName" class="required">Last Name:</label>
      <input type="text" id="register-lastName" name="register-lastName" required /><br />

      <label for="username" class="required">Username:</label>
      <input type="text" id="register-username" name="register-username" required />
      <span id="usernameAvailability"></span><br />

      <label for="password" class="required">Password:</label>
      <input type="password" id="register-password" name="register-password" required /><br />

      <label for="email" class="required">Email:</label>
      <input type="email" id="register-email" name="register-email" required /><br />
      <span id="emailAvailability"></span><br />

      <label for="phone" class="required">Phone Number:</label>
      <input type="tel" id="register-phone" name="register-phone" required /><br />
      <span id="telAvailability"></span><br />

      <label for="bloodGroup" class="required">Blood Group:</label>
      <select id="register-bloodGroup" name="register-bloodGroup">
        <option value="A+">A+</option>
        <option value="A-">A-</option>
        <option value="B+">B+</option>
        <option value="B-">B-</option>
        <option value="O+">O+</option>
        <option value="O-">O-</option>
        <option value="AB+">AB+</option>
        <option value="AB-">AB-</option>
        <option value="Unknown">Unknown</option>
      </select><br />

      <label for="lastDonationDate">Last Donation Date:</label>
      <input type="date" id="register-lastDonationDate" name="register-lastDonationDate" />
      <p class="note">Leave empty if unsure</p>
      <button type="submit" id="registerButton">Register</button>
      <p class="note-asterisk">Note: Fields marked with <span style={{ fontSize: "1.2em" }}>*</span> are mandatory</p>

    </form>
  </div>
    </div>
  );
};

const SignUpAsUser = () => {
  // Similar to UserRegistration component, you can add the sign-up logic here

  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>Sign Up as User</h2>
        {/* ... sign-up form fields ... */}
      </div>
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/user-login" element={<UserLogin />} />
        <Route path="/admin-login" element={<AdminLogin />} />
        <Route path="/login-doctor" element={<DoctorLogin />} />
        <Route path="/user-registration" element={<UserRegistration />} />
        <Route path="/sign-up-as-user" element={<SignUpAsUser />} />
        {/* Set the default route to UserLogin */}
        <Route index element={<UserLogin />} />
      </Routes>
    </Router>
  );
};

export default App;
